void arx_best_rot_two() {
	uint32_t block_rot;
	uint32_t alpha, gamma;
	uint32_t a1, a2, g1, g2;

	uint32_t xdp_total = 0;
	uint32_t xdp_max[PART_BIT_LEN - 1];
	uint32_t xdp_count_max[PART_BIT_LEN - 1];

	uint32_t min_rot;

	FILE *f = fopen("/media/sf_Alexander/best_rot_search_8(2 rounds).txt", "w");

	xdp_max[0] = 0;
	xdp_max[1] = 0;
	xdp_max[2] = 0;
	xdp_count_max[0] = 0;
	xdp_count_max[1] = 0;
	xdp_count_max[2] = 0;
	for (block_rot = 1; block_rot < PART_BIT_LEN; ++block_rot) {
		fprintf(f, "ROT = %d \n", block_rot);
		for (alpha = 1; alpha < BLOCK_SPACE; ++alpha) {

			a1 = alpha >> PART_BIT_LEN;
			a2 = alpha & PART_BIT_MASK;
			for (gamma = 0; gamma < BLOCK_SPACE; ++gamma) {
				g1 = gamma >> PART_BIT_LEN;
				g2 = gamma & PART_BIT_MASK;

				xdp_total = XDP_8[a2][(ROT_LO((a1 ^ g1), block_rot))] * XDP_8[g1][(ROT_LO((a2 ^ g2), block_rot))];

				if (xdp_total != 65536 && xdp_max[block_rot - 1] < xdp_total) {
					xdp_max[block_rot - 1] = xdp_total;
					xdp_count_max[block_rot - 1] = 1;
				} else if (xdp_max[block_rot - 1] == xdp_total) {
					++xdp_count_max[block_rot - 1];
				}
			}
		}
		fprintf(f, "xdp_max = %d, xdp_count = %d\n* * * * *\n", xdp_max[block_rot - 1], xdp_count_max[block_rot - 1]);
	}

	min_rot = 1;
	for (block_rot = 2; block_rot < PART_BIT_LEN; ++block_rot) {
		if (xdp_count_max[block_rot - 1] < xdp_count_max[min_rot - 1])
			min_rot = block_rot;
	}
	fprintf(f, "\n");
	fprintf(f, "best_rot = %d\n", min_rot);

	fclose(f);
}

